import React from "react";
import styled from "styled-components";

const Button = styled.button`
    margin: 10px 10px;
    font-size: 40px;
`;

const FundingDetailPresenter = () => {
    return <Button>펀딩하기</Button>;
};

export default FundingDetailPresenter;
